import React from 'react'

export default function Navbar()
{
return(
<nav class="topnav">
  <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
</nav>
)

}
